        <ul>
            <li>Also known as the southern house mosquito</li>
            <li>Mosquito Size: Approximately 3.96 to 4.25 millimeters long</li>
            <li>Mosquito Color: This brown mosquito, with a darker proboscis, thorax, wings, and tarsi, and a lighter brown head and center.</li>
            <li>Other distinct features: The abdomen has pale, narrow, rounded bands that take on a half-moon shape</li>
